import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import "./updateUser.css";

export default function UpdateUser() {
  const location = useLocation();
  const [fname, setFname] = useState("");
  const [lname, setLname] = useState("");
  const [email] = useState(""); // Since email is not updated, there's no need for a state.

  useEffect(() => {
    // Check if location state and its data property exist before setting fname and lname.
    if (location.state && location.state.data) {
      setFname(location.state.data.fname);
      setLname(location.state.data.lname);
    }
  }, [location]);


  const updateData = () => {
    console.log(fname, lname);
  }

  return (
    <div>
      <form className="update_form">
        <h2 className="header">Update Account</h2>
        <div className="larger_inputContainer">
          <div className="mb-3">
            <label>First Name</label>
            <input
              className="form-control larger_input"
              type="text"
              placeholder="First Name"
              value={fname}
              onChange={(e) => setFname(e.target.value)}
              required
            />
            <label>Last Name</label>
            <input
              className="form-control larger_input"
              type="text"
              placeholder="Last Name"
              value={lname}
              onChange={(e) => setLname(e.target.value)}
              required
            />
            <label>Email</label>
            <input
              className="form-control larger_input"
              type="text"
              placeholder="Email"
              value={email}
              disabled
            />
            <button onClick={updateData} className="btn btn-primary button">
              Update Details
            </button>
          </div>
        </div>
      </form>
    </div>
  );
}
